import React from 'react'; 
import AddNewFish from './AddNewFish';
import EditFishForm from './EditFishForm';

class Inventory extends React.Component{
    render(){
        return (<div className="inventory">
            <h2>Inventory</h2>
            { Object.keys(this.props.fishes).map(key => <EditFishForm key={key} index={key} fish={this.props.fishes[key]} /> ) }
            <AddNewFish addFish={this.props.addFish}/>
            <button onClick={this.props.loadSamplesFishes}>Load Sample Fishes!</button>
        </div>)
    }
}

export default Inventory;
